import React from "react";
import Product from "./product";




const ListProducts=(props)=>{
    const Productss = [ 
            { 
                id: 1, 
                title: 'PC Portable Gamer HP VICTUS', 
                price: '7490 DH', 
                thumbnail :  "capture1.PNG"
            }, 
            { 
                id: 2, 
                title: 'PC Portable Gamer HP VICTUS',
                price: '2190 DH', 
                thumbnail : 'Capture2.PNG' 
            }, 
            { 
                id: 3, 
                title: 'Pc Portable Chromebook Acer',
                price: '3640 DH', 
                thumbnail: 'Capture3.PNG' 
            }, 
            { 
                id: 4, 
                title: 'PC Portable - HUAWEI',
                price: '1270 DH', 
                thumbnail: 'Capture4.PNG' 
            }, 
        ]; 
        
    return(
        <main className="container"> 
            <h1>Ordinateurs portables</h1> 
            <div className="row mb-2">
                {props.Products.map((e)=> <Product key={e.id} thumbnail={e.thumbnail} title={e.title} price={e.price} id={e.id}/>) }
            </div> 
        </main> 
        
        
    )
}

export default ListProducts;
